message: "Rolex Submariner,   выпущенная в 1954 году стала  первой дайверской моделью, выдерживающими глубину до  330 футов. \r\nЧасы оснащены  вращающийся безель ,  Triplock-заводную головку, обеспечивающие герметичность  даже в экстремальных условиях. \r\nДизайн  включает  светящиеся маркеры,  стальной корпус Oystersteel, подчеркивающие функциональность . \r\n<a href=\"https://rolex-submariner-shop.ru\">Хронометры Rolex Submariner цены</a> \r\n Автоподзавод до 70 часов  сочетается с автоматическим калибром , что делает их  идеальным выбором для активного образа жизни. \r\nС момента запуска  Submariner стал  символом часового искусства, оцениваемым как  эксперты."
